 	      using System;
	      using System.IO;
	      using System.Text;
	      using Skyline.DataMiner.Scripting;

	      public class QAction{
		      public static void Run(SLProtocol protocol, Object type){
			      Int32 x = Convert.ToInt32(type);

            //get datetime
            DateTime saveNow = DateTime.Now;              
            String timeStamp = saveNow.ToString();              

            Int32 rowPosition = protocol.GetKeyPosition(65010,x.ToString());
            if(rowPosition != 0){
              Object[] newValue = new Object[5]{null,0,"","",timeStamp};
              protocol.SetRow(65010,x.ToString(),newValue);              
           }
		      }
	      }



 	      using System;
	      using System.IO;
	      using System.Text;
	      using Skyline.DataMiner.Scripting;

	      public class QAction{
		      public static void Run(SLProtocol protocol, Object PID){
			      Int32 x = Convert.ToInt32(PID);

            Int32 rowPosition = protocol.GetKeyPosition(65010,PID.ToString());

            //get datetime
            DateTime saveNow = DateTime.Now;              
            String timeStamp = saveNow.ToString();              

            if(rowPosition == 0){
              // add row
         			Object [] row = new Object[5]{Convert.ToString(x),(double)1,timeStamp,timeStamp,""};
			        protocol.NotifyProtocol(149/*NT_ADD_ROW*/,65010,row);
            }else{
              // update row    

              //get current counter
              Int32 currentCount = Convert.ToInt32(protocol.GetParameterIndexByKey(65010,PID.ToString(),2));
              //set value
              Object[] newValue = new Object[5]{null,currentCount + 1,null,timeStamp,null};

              if(currentCount == 0){
                //set dateTime
                newValue[2] = timeStamp;
              }              
              protocol.SetRow(65010,Convert.ToString(x),newValue);
            }


            //update elementcounter
            Int32 rowPositionElement = protocol.GetKeyPosition(65010,"-1");
            if(rowPositionElement == 0){
               // add row
         			Object [] row = new Object[5]{"-1",(double)1,timeStamp,timeStamp,""};
			        protocol.NotifyProtocol(149/*NT_ADD_ROW*/,65010,row);
            }else{
              // update row            
              //get current counter
              Int32 currentCount = Convert.ToInt32(protocol.GetParameterIndexByKey(65010,"-1",2));             
              //set value
              Object[] newValue = new Object[5]{null,currentCount + 1,null,timeStamp,null};

              if(currentCount == 0){
                //set dateTime
                newValue[2] = timeStamp;
              }              
              protocol.SetRow(65010,"-1",newValue);

            }
		      }
	      }



 	      using System;
	      using System.IO;
	      using System.Text;
	      using Skyline.DataMiner.Scripting;

	      public class QAction{
		      public static void Run(SLProtocol protocol, Object value){
			      String newValue = Convert.ToString(value);
            String type = "Text";
            bool bUpdateProperty = false;

            Int32 rowPosition = protocol.GetKeyPosition(65019,protocol.RowKey());
            if(rowPosition != 0){
              type = Convert.ToString(protocol.GetParameterIndexByKey(65019,protocol.RowKey(),2));

              if(type.ToLower() != "read-only"){                 
                 bUpdateProperty = true;
              }

              if(bUpdateProperty){
                 String[] properties = new String[3];

                 properties[0] = protocol.RowKey();
                 properties[1] = type;
                 properties[2] = newValue;

                 protocol.NotifyDataMinerQueued(62/*NT_EDIT_PROPERTY*/,"element:" + Convert.ToString(protocol.ElementID) + ":" + Convert.ToString(protocol.DataMinerID),properties);         
              }
            }

		      }
	      }



 	      using System;
	      using System.IO;
	      using System.Text;
	      using Skyline.DataMiner.Scripting;

	      public class QAction{
		      public static void Run(SLProtocol protocol, Object value){
                  string action = Convert.ToString(value);
                  string ADD_ROW = "1";
                  string DELETE_ROW = "2";

                  ///
                  ///Fill Connections table (PID 65060)
                  ///

                  if (action == ADD_ROW)
                  {
                      //take | seperated data from the input parameter
                      string input = Convert.ToString(protocol.GetParameter(65099));

                      string[] data = input.Split('|');

                      object[] row = new object[5] {null, null, null, null, null};

                      if (data.GetUpperBound(0) >= 3)
                      {
                          row[1] = data[0];
                          row[2] = data[1];
                          row[3] = data[2];
                          row[4] = data[3];
                      }

                      protocol.NotifyProtocol(149/*NT_ADD_ROW*/, 65060, row);
                  }
                  else if (action == DELETE_ROW)
                  {
                      protocol.NotifyProtocol(156 /*NT_DELETE_ROW*/, 65060, Convert.ToString(protocol.GetParameter(65079)));
                  }  
		      }
	      }



