using System;
using System.IO;
using System.Text;
using Skyline.DataMiner.Scripting;
using System.Linq;
using System.Collections.Generic;

public class QAction {
    public static void Run(SLProtocol protocol, Object value)
    {
        ClearTable(protocol, 65122);
    }

    public static void ClearTable(SLProtocol protocol, int iTableID)
	{
		string[] indices;
		Object[] result = (Object[])protocol.NotifyProtocol(168, iTableID, null);
		int size = result.Length;
		if (size > 0)
		{
		    if (null != result.GetValue(0))
			{
				Object[] primaryIndexes = (Object[])result.GetValue(0);
				indices = Array.ConvertAll<Object, string>(primaryIndexes, new Converter<Object, string>(Convert.ToString));

                List<string> indicesToDelete = new List<string>();
                for(int i = 0; i < indices.Length; i++)
                {
                    string key = indices[i];
                    object[] row = protocol.NotifyProtocol(215, new object[] { iTableID, key }, null) as object[];
                    if (row.GetUpperBound(0) >= 1)
                    {
                        if (row[1] == null)
                        {
                            indicesToDelete.Add(key);
                        }
                    }
                }

                indices = indicesToDelete.ToArray();
		    }   
			else
			{
				indices = new string[0];
			}
		}
		else
		{
			indices = new string[0];
		}				
		protocol.NotifyProtocol(156, iTableID, indices);
	}
}



 	      using System;
	      using System.IO;
	      using System.Text;
	      using Skyline.DataMiner.Scripting;

	      public class QAction
        {
		        public static void Run(SLProtocol protocol, Object value)
            {
                string action = Convert.ToString(value);
                string ADD_ROW = "1";
                string DELETE_ROW = "2";
                string DELETE_ALL = "3";

                if (action == ADD_ROW)
                {
                    object[] row = new object[5] { null, null, null, null, null };
                    protocol.NotifyProtocol(149/*NT_ADD_ROW*/, 65132, row);
                }
                else if (action == DELETE_ROW)
                {
                    var parameter = Convert.ToString(protocol.GetParameter(66154));
                    protocol.NotifyProtocol(156 /*NT_DELETE_ROW*/, 65132, parameter);
                }
                else if (action == DELETE_ALL)
                {
                    protocol.ClearAllKeys(65132);
                }
            }
        }



